import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./componets/Telainicial/Home";
import CadastroCliente from "./componets/CadastroCliente/CadastroCliente";
import Cadastroinstrumento from "./componets/CadastroInstrumento/CadastroInstrumento";
import "./index.CSS";

function App() {
  return (
    <div className="pagina">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/cadastrocliente" element={<CadastroCliente />} />
          <Route
            path="/cadastroinstrumento"
            element={<Cadastroinstrumento />}
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
